import React from 'react';

const CryptoList = (props) => {

    const currencyList = props.cryproArray.map((currency, index => {
        return (<li key={index}>Last Rate: {currency.last}</li>)
    }))

    return(
        <ul>{currencyList}</ul>
    )
}

export default CryptoList;
